      filtered = filtered.filter(item => item.year === y && item.month === m && item.day === d);
    } else if (mode === 'month') {
      if (year) filtered = filtered.filter(item => item.year === year);
      if (month) filtered = filtered.filter(item => item.month === month);
    }

    if (heatLayer) map.removeLayer(heatLayer);
    markerLayer.clearLayers();

    const heatData = filtered.map(item => [item.Latitude, item.Longitude]);
    if (heatData.length > 0) {
      heatLayer = L.heatLayer(heatData, {
        radius: 20,
        blur: 25,
        maxZoom: 10,
        gradient: {
          0.2: 'blue',
          0.4: 'lime',
          0.6: 'orange',
          0.8: 'red'
        }
      }).addTo(map);
      map.setView(heatData[0], 7);
    }

    if (showSentiment) {
      const colors = { positive: 'green', negative: 'red', neutral: 'blue' };
      filtered.forEach(item => {
        if (item.sentiment) {
          L.circleMarker([item.Latitude, item.Longitude], {
            radius: 3,
            color: colors[item.sentiment] || 'gray',
            fillOpacity: 0.7
          }).bindTooltip("Sentiment: " + item.sentiment).addTo(markerLayer);
        }
      });
    }
  }

  let heatLayer;
  let markerLayer = L.layerGroup().addTo(map);

  yearFilter.addEventListener('change', () => {
    updateMonths();
    updateMap();
  });
  monthFilter.addEventListener('change', updateMap);
  dateFilter.addEventListener('change', updateMap);
  sentimentToggle.addEventListener('change', updateMap);
  filterRadios.forEach(r => r.addEventListener('change', updateMap));

  yearFilter.value = years[0];
  updateMonths();
  updateMap();
</script>

</body>
</html>
